import Skeleton from "react-loading-skeleton";
import { Link } from "react-router-dom";

const User = ({ username, fullName }) => {
  !username || !fullName ? (
    <Skeleton count={1} height={61} />
  ) : (
    <Link to={`/p/${username}`} className="grid">
      <p>{username}</p>
    </Link>
  );
};

export default User;
